import React from "react";
import "../App.css";
import "../css/Contact.css";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faBlogger, faGithub } from "@fortawesome/free-brands-svg-icons";

const contactStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    icon: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function Contact() {
  const contactStyle = contactStyles();

  return (
    <div id="contact" className="menu-top-padding">
      <div>
        <p className="menu-name">Contact</p>
      </div>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={4} md={5}>
          <FontAwesomeIcon icon={faEnvelope} className="icon-size" />
          <p className="text-bold text-1H text-color-bl">Email</p>
        </Grid>
        <Grid item xs={12} sm={4} md={2}>
          <a href="https://blog.naver.com/dev_seung2" target="_blank">
            <FontAwesomeIcon icon={faBlogger} className="icon-size" />
          </a>
          <p className="text-bold text-1H text-color-bl">Blog</p>
        </Grid>
        <Grid item xs={12} sm={4} md={5}>
          <a href="https://blog.naver.com/dev_seung2" target="_blank"></a>
          <FontAwesomeIcon icon={faGithub} className="icon-size" />
          <p className="text-bold text-1H text-color-bl">Github</p>
        </Grid>
      </Grid>
    </div>
  );
}

export default Contact;
